script: |
  super -f text -I q7711.spq | sort > q7711.out

inputs:
  - name: q7711.spq
    data: |
      SELECT DISTINCT COUNT ( * ) FROM tab0 (FORMAT parquet) WHERE NOT col0 = - + col2 * - col1 + col2 + - col1 + 84 * col0 * - + col1;
  - name: tab0

outputs:
  - name: q7711.out
    data: |
      3
